import React from "react";

const Home = () => {
  return (
    <div>
      <h1>Welcome to Wemes</h1>
    </div>
  );
};

export default Home;


const [transactionsData, setAccountData] = useState([]);


const getAccounts = () => {
  console.log(WEMES_URL);
  axios
    .get(`${WEMES_URL}transactis/`)
    .then((response) => {
      console.log(response);
      const newData = response.data.map((transactions) => {
        return {
          id: transactions.id,
          first_name: transactions.first_name,
          last_name: transactions.last_name,
          last_four: transactions.last_four,
          phone_num: transactions.phone_num,
          email: transactions.email,
          code: transactions.code,
          admin: transactions.admin,
          is_active: transactions.is_active,
          transactions: transactions.transactions,
        };
      });
      setAccountData(newData);
    })
    .catch((err) => {
      alert(err);
    });
};

useEffect(() => getAccounts(), []);
